import React from 'react';
import { useFormik } from 'formik';

function Calc() {
    return (
        <div className='Calc container mx-auto bg-white py-10 px-6 sm:w-260 w-500'>
            <div className='container mx-auto'>
                <form className="mx-auto bg-white shadow-md rounded px-8 pt-6 pb-8 mb-4">
                    <div className="mb-4 ">
                        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="name">
                            Name
                        </label>
                        <input className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" id="name" type="text" placeholder="Name" />
                    </div>
                    <div className="flex items-center justify-between">
                        <button className="bg-gold  text-white py-2 px-4 rounded " type="submit">
                            Submit
                        </button>
                    </div>
                </form>
            </div>
        </div>
    );
}

export default Calc;
